import s from './AdminPostSection.module.css';

const AdminPostSection = () => {
	return (
		<div className={`section-container`}>
			<div className={s.post}>
				<input placeholder="Заголовок" className={s.title}></input>
			</div>
		</div>
	);
};

export default AdminPostSection;
